import{_ as a,c as n,a3 as i,o as t}from"./chunks/framework.BRvtVtzd.js";const g=JSON.parse('{"title":"HaunBlog Introduction","description":"Learn to Financial Engineering and Risk Management","frontmatter":{"title":"HaunBlog Introduction","description":"Learn to Financial Engineering and Risk Management","head":[["meta",{"property":"og:title","content":"HaunBlog Introduction"}],["meta",{"property":"og:description","content":"Learn to Financial Engineering and Risk Management"}],["meta",{"property":"og:image","content":"/images/haunblog.png"}],["meta",{"property":"og:url","content":"https://haun84.github.io/guide/intro"}]]},"headers":[],"relativePath":"guide/intro.md","filePath":"en/guide/intro.md","lastUpdated":null}'),o={name:"guide/intro.md"};function r(l,e,s,d,c,u){return t(),n("div",null,e[0]||(e[0]=[i('<h1 id="haunblog-introduction" tabindex="-1">HaunBlog Introduction <a class="header-anchor" href="#haunblog-introduction" aria-label="Permalink to &quot;HaunBlog Introduction&quot;">​</a></h1><div class="info custom-block"><p class="custom-block-title">Language</p><ul><li><a href="/ko/guide/intro">한국어 페이지: Korean Page</a></li></ul></div><h2 id="haunblog-story" tabindex="-1">HaunBlog Story <a class="header-anchor" href="#haunblog-story" aria-label="Permalink to &quot;HaunBlog Story&quot;">​</a></h2><div class="warning custom-block"><p class="custom-block-title">HaunBlog Story</p><p>I am working on creating a blog to refine myself by organizing topics related to work and my personal interests.</p><p>During my school days, and even now in my professional life, I have become more accustomed to dealing with numbers and formulas than writing. As a result, I haven’t had many opportunities to write or speak in front of large groups of people. However, through personal study, I have realized that the content I absorb is better organized when I discuss it with others or put it into writing.</p><p>I plan to practice refining my thoughts by organizing the specialized knowledge I’ve gained while working. Over the course of more than 10 years, I have worked in various areas of finance, so there are things I am already well-versed in, as well as new knowledge I am currently learning. While my writing may not be at an advanced level, I believe it could still be helpful to some, and I hope you approach it with the same mindset of learning together.</p><p>Thank you.</p></div><p><code>VitePress</code> is a <code>Static Site Generator (SSG)</code> designed for building fast, content-centric websites. In a nutshell, VitePress takes your source content written in Markdown, applies a theme to it, and generates static HTML pages that can be easily deployed anywhere.<br><code>HaunBlog</code> is written by <code>VitePress</code>.</p><h2 id="quantlib" tabindex="-1">QuantLib <a class="header-anchor" href="#quantlib" aria-label="Permalink to &quot;QuantLib&quot;">​</a></h2><ul><li><a href="/quantlib/intro">QuantLib</a></li></ul><h2 id="haun-feed" tabindex="-1">Haun Feed <a class="header-anchor" href="#haun-feed" aria-label="Permalink to &quot;Haun Feed&quot;">​</a></h2><ul><li><a href="/feed/guide">Feed Guide</a></li><li><a href="/feed/money-policy/intro">Helpful Policy</a></li><li><a href="/feed/finance-talk/guide">Finance Talk</a></li></ul><h2 id="finance" tabindex="-1">Finance <a class="header-anchor" href="#finance" aria-label="Permalink to &quot;Finance&quot;">​</a></h2><ul><li><a href="/finance/guide">Guide</a></li><li><a href="/finance/financial-overview/intro">The Overview of Financial System in Korea</a></li><li><a href="/finance/financial-stability/intro">Financial Stability</a></li><li><a href="/finance/monetary-policy/objectives-framework">Monetary Policy</a></li><li><a href="/financial-markets-in-korea/overview">Financial Markets in Korea</a></li><li><a href="/bond/intro">The Basics of the Bonds</a></li></ul><h2 id="development" tabindex="-1">Development <a class="header-anchor" href="#development" aria-label="Permalink to &quot;Development&quot;">​</a></h2><ul><li><a href="/guide/making-blog">Creating a Personal Blog on Github Pages with VitePress</a></li><li><a href="/development/seo/intro">SEO: Search Engine Optimization</a></li><li><a href="/pandas-dataframe/intro">Pandas DataFrame</a></li></ul>',13)]))}const p=a(o,[["render",r]]);export{g as __pageData,p as default};
